import { Table } from "antd";

function ThreatsTable() {
  return (
    <div>
      <h3 style={{ color: "white" }}>Detected Cyber Security Threats</h3>
      <Table
        dataSource={dataSource}
        columns={columns}
        pagination={{
          defaultPageSize: 10,
        }}
      />
    </div>
  );
}

const dataSource = [
  {
    datetime: "01-01-2023 12:00:00",
    ip: "192.168.1.100",
    mac: "255.255.255.0",
    threat: "Trojan",
  },
  {
    datetime: "01-01-2023 12:00:00",
    ip: "192.168.1.101",
    mac: "255.255.255.0",
    threat: "Trojan",
  },
  {
    datetime: "01-01-2023 12:00:00",
