  },
  {
    datetime: "01-01-2023 12:00:00",
    ip: "192.168.1.108",
    mac: "255.255.255.0",
    threat: "Trojan",
  },
  {
    datetime: "01-01-2023 12:00:00",
    ip: "192.168.1.109",
    mac: "255.255.255.0",
    threat: "Trojan",
  },
];

const columns = [
  {
    title: "Date / Time",
    dataIndex: "datetime",
    key: "datetime",
  },
  {
    title: "Targeted IP Address",
    dataIndex: "ip",
    key: "ip",
  },
  {
    title: "MAC Address",
    dataIndex: "mac",
    key: "mac",
  },
  {
    title: "Threat Type",
    dataIndex: "threat",
    key: "threat",
    filterSearch: "true",
    filters: [
      {
        text: "Trojan",
        value: "Trojan",
      },
      {
        text: "Rootkit",
        value: "Rootkit",
      },
    ],
    onFilter: (value, record) => record.threat.includes(value),
  },
];

export default ThreatsTable;
